package db.domain;import java.util.Date;public class PvpRanksImpl implements PvpRanks {	private String uname;	private String status;	private Date pvpUpTime;	private int danId;	private int v4;	public PvpRanksImpl() {	}	public PvpRanksImpl(PvpRanks c) {		this.uname = c.getUname();		this.status = c.getStatus();		this.pvpUpTime = c.getPvpUpTime();		this.danId = c.getDanId();		this.v4 = c.getV4();	}	@Override	public String tableName() {		return "pvp_ranks";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setStatus(String status) {		this.status = status;	}	public String getStatus() {		return this.status;	}public void addStatus(String status) {		this.status += status;}	public void setPvpUpTime(Date pvpUpTime) {		this.pvpUpTime = pvpUpTime;	}	public Date getPvpUpTime() {		return this.pvpUpTime;	}	public void setDanId(int danId) {		this.danId = danId;	}	public int getDanId() {		return this.danId;	}public void addDanId(int danId) {		this.danId += danId;}	public void setV4(int v4) {		this.v4 = v4;	}	public int getV4() {		return this.v4;	}public void addV4(int v4) {		this.v4 += v4;}}